INSERT INTO `pages` VALUES (1,'Giới thiệu','gioi-thieu',NULL,'<p>Chào mừng quý khách đến với thế giới đèn trang trí nội thất Gia Lai. Nội thất đèn gia lai với tiêu chí làm thõa mãn nhu cầu hoàn thiện giá trị thẩm mỹ cho căn nhà của quý khách, chúng tôi đặt tính chuyên nghiệp, sự uy tín, tậm tâm lên hàng đầu để phục vụ quý khách hàng. Với kiến thức về kỹ thuật và sự am tường\r\n nghệ thuật trang trí, chúng tôi sẽ tập trung tư vấn cho Quý khách hàng \r\ndễ dàng chọn lựa được các sản phẩm đèn trang trí phù hợp và hoàn hảo \r\nnhất cho không gian sống của khách hàng từ cao cấp đến bình dân.\r\n\r\n Chúng tôi cam kết mang đến cho Quý khách \r\nhàng những sản phẩm có chất lượng tốt nhất, hiện đại nhất bằng chính sự \r\ntrân trọng, niềm tin và trách nhiệm của mình với kim chỉ nam hành động&nbsp; Kinh doanh gắn liền với Uy tín, Chất lượng . </p>',NULL,NULL,NULL,1,NULL,0,1,0,NULL,1,'2017-12-08 05:15:42','2020-09-21 12:29:15',NULL,NULL,1),(2,'Liên hệ','lien-he',NULL,'<p>\r\n \r\n  \r\n   Showroom TP.HCM: 75 Trường Chinh, P.12, Tân Bình, TP.HCM (Gần Ngã Tư Bảy Hiền)\r\n \r\n \r\n  \r\n   Điện thoại: (028) 6275 8787 - (028) 6684 0229 - (028) 2245 8144\r\n \r\n\r\n\r\n \r\n  Hotline - Zalo: 0989 475 868 (Ms. Hương) - 0905 269 751 (Ms. Ty)&nbsp; - 0937 309 879 (Ms. Loan)\r\n\r\n\r\n \r\n  \r\n   Email: hungthanh@thegioianhsang.vn\r\n \r\n\r\n</p><p>[contact]</p>',NULL,NULL,NULL,1,NULL,0,1,0,NULL,2,'2017-12-12 19:41:02','2020-09-05 16:51:53',NULL,NULL,0),(3,'Về chúng tôi','ve-chung-toi',NULL,NULL,'Về chúng tôi','Cửa hàng cafe','Cửa hàng cafe',1,'/photos//5a2d162c66b3b.gif',0,0,0,NULL,3,'2018-02-06 04:29:45','2019-07-13 04:43:20',NULL,NULL,0),(5,'HƯỚNG DẪN THANH TOÁN','huong-dan-thanh-toan',NULL,'<p>Bạn vui lòng chuyển khoản vào các số tài khoản sau </p><p>1. Ngân hàng Vietcombank:\r\n</p><ul><li>STK: 0461000514475\r\n</li><li>TRẦN THỊ HẰNG \r\n</li><li>Chi Nhánh: Sóng Thần Bình Dương \r\n</li></ul><p>2. Ngân hàng Agribank : </p><ul><li>STK: 4301205061571, </li><li>Trần Thị Hằng</li><li>Chi Nhánh : Quy Nhơn Bình Định\r\n</li></ul><p>3.Ngân hàng ACB:\r\n</p><ul><li>STK: 9844367\r\n</li><li>TRẦN THỊ HẰNG \r\n</li><li>Chi Nhánh: PGD Nguyễn Sơn, Hồ Chí Minh \r\n</li></ul><p>\r\n4.Momo\r\n</p><ul><li>STK: 0377034538\r\n</li><li>TRẦN THỊ HẰNG</li></ul>',NULL,NULL,NULL,1,NULL,0,1,0,NULL,5,'2018-02-11 12:45:21','2020-05-24 10:49:45',NULL,NULL,1),(6,'CHÍNH SÁCH ĐỔI TRẢ','chinh-sach-doi-tra',NULL,NULL,'','myphamtrangda, mỹ phẩm trắng da, sỉ lẻ mỹ phẩm, my phẩm pháp, mỹ phẩm nhập khẩu','CHÍNH SÁCH ĐỔI TRẢ | Đổi trả hàng tại Mỹ phẩm Minh Trang',1,NULL,0,1,0,NULL,6,'2018-02-11 12:47:11','2019-07-13 04:40:47',NULL,NULL,0),(9,'Hướng dẫn mua hàng','huong-dan-mua-hang','Nếu quý khách cảm thấy không có thời gian, quý khách có thể đặt hàng nhanh bằng cách chỉ cần để lại thông tin tên, số điện thoại, email qua hộp hội thoại chat CUAHANGCAFE.COM sẽ liên lạc lại với quý khách.',NULL,'','linh kiện, phụ kiện, kinh doanh cà phê','Gọi điện thoại đến chúng tôi qua hotline 0963.567.123  từ 7h30 – 21h00 chúng tôi luôn sẵn sàng phục vụ quý khách.',1,NULL,0,1,1,NULL,9,'2019-07-02 19:01:11','2019-07-02 19:01:11',NULL,NULL,0),(10,'chính sách bảo hành','chinh-sach-bao-hanh',NULL,NULL,NULL,NULL,NULL,1,NULL,0,1,0,NULL,10,'2019-07-13 04:41:27','2019-07-13 04:41:27',NULL,NULL,0),(11,'Chính sách giao hàng','chinh-sach-giao-hang',NULL,NULL,NULL,NULL,NULL,1,NULL,0,1,0,NULL,11,'2019-07-13 04:42:07','2020-02-22 14:00:23','<style>\r\n    color:black;\r\n</style>','<script>\r\n    console.log(\'Page chinh sach giao hang loaded\')\r\n</script>',0);
