INSERT INTO `posts` VALUES (60,7,'Mua đèn trang trí nội thất tại Gia Lai?','mua-den-trang-tri-noi-that-tai-gia-lai-841','Không khó để thấy những mẫu đèn led trang trí được sử dụng trong đời sống hằng ngày. Loại đèn này được ứng dụng trong rất nhiều lĩnh vực khác nhau. Ta có thể kể đến như: trang trí quán cafe, trang trí shop thời trang, trang trí phòng Karaoke, trang trí nhà ở, trang trí sân vườn, trang trí bàn thờ, trang trí quầy bar, trang trí quán ăn, trang trí công viên, trang trí trường mầm non,... Đặc biệt đèn led trang trí tphcm còn được dùng để trang trí vào','<p class=\"XzvDs _208Ie tFDi5 blog-post-text-font blog-post-text-color _2QAo- _25MYV _6RI6N\">Nội dung đang được cập nhật</p>\r\n<p class=\"XzvDs _208Ie tFDi5 blog-post-text-font blog-post-text-color _2QAo- _25MYV _6RI6N\"><img src=\"/public/storage/files/4/Den-trang-tri/den-tha-tran-kim-cuong-trang-tri-noi-that.jpg\" alt=\"\" width=\"800\" height=\"800\" /></p>','Đèn led trang trí nội thất giá tốt nhất tại gia lai',NULL,'Top 5 địa điểm bán đèn trang trí nội thất tốt nhất Gia Lai','uploads/posts/featured/Den-tha-trang-tri-phong-an-mau-den-dai-vivadi-gia-re-thanh-hoa.jpg',0,4,1,1,NULL,NULL,'2020-04-04 05:00:55','2020-09-21 12:34:43','Đèn trang trí nội thất quán cafe, đèn trang trí nội thất gia lai',NULL,NULL),(61,7,'Top 20 mẫu đèn trang trí phòng khách nổi bật','top-20-mau-den-trang-tri-phong-khach-noi-bat-187','Đèn led ốp trần ra đời, đáp ứng được nhu cầu mong muốn của khách hàng về việc sử dụng các thiết bị chiếu sáng tiết kiệm điện năng. Không chỉ vậy, đèn led ốp trần còn có rất nhiều tình năng ưu việt khác. Vậy những tính năng nổi bật của đèn led ốp trần là gì? Lý do nào giúp sản phẩm trở nên phổ biến và được yêu thích như vậy? Hãy cùng Viva Led tìm hiểu thêm qua bài viết dưới đây','<p class=\"XzvDs _208Ie tFDi5 blog-post-text-font blog-post-text-color _2QAo- _25MYV _6RI6N\">Nội dung đang được cập nhật</p>\r\n<p class=\"XzvDs _208Ie tFDi5 blog-post-text-font blog-post-text-color _2QAo- _25MYV _6RI6N\"><img src=\"/public/storage/files/4/Den-trang-tri/den-tha-tran-kim-cuong-trang-tri-noi-that.jpg\" alt=\"\" width=\"800\" height=\"800\" /></p>','Đèn led trang trí giá tốt nhất ở tphcm',NULL,'thay đổi tên miền kiemtienmobi.com','uploads/posts/featured/den-tha-trang-tri-dep-gia-re-thu-duc.jpg',0,4,1,1,'0000-00-00 00:00:00',NULL,'2020-04-04 05:00:55','2020-09-06 15:06:39','','',''),(62,7,'Top 10 ưu điểm nổi bật của các mẫu đèn led trần hiện nay','top-10-uu-diem-noi-bat-cua-cac-mau-den-led-tran-hien-nay-769','Đèn led ốp trần vận hành dựa trên công nghệ bán dẫn P và N. Khối bán dẫn loại P mang điện tích dương và khối bán dẫn loại N mang điện tích âm. Khi 2 khối bán dẫn hoạt động sẽ khuếch tán sang nhau và tạo ra năng lượng ánh sáng. Mỗi mức năng lượng được giải phóng ra khác nhau là cao hay thấp, bước sóng ánh sáng cũng khác nhau. Màu sắc của đèn ốp trần và mức năng lượng phụ thuộc vào cấu trúc năng lượng của những nguyên tử bán dẫn.','<p class=\"XzvDs _208Ie tFDi5 blog-post-text-font blog-post-text-color _2QAo- _25MYV _6RI6N\">Nội dung đang được cập nhật</p>','Đèn led ốp trần vận hành dựa trên công nghệ bán dẫn P và N. Khối bán dẫn loại P mang điện tích dương và khối bán dẫn loại N mang điện tích âm. Khi 2 khối bán dẫn hoạt động sẽ khuếch tán sang nhau và tạo ra năng lượng ánh sáng. Mỗi mức năng lượng được giải phóng ra khác nhau là cao hay thấp, bước sóng ánh sáng cũng khác nhau. Màu sắc của đèn ốp trần và mức năng lượng phụ thuộc vào cấu trúc năng lượng của những nguyên tử bán dẫn.',NULL,'Đèn led ốp trần vận hành dựa trên công nghệ bán dẫn P và N. Khối bán dẫn loại P mang điện tích dương và khối bán dẫn loại N mang điện tích âm. Khi 2 khối bán dẫn hoạt động sẽ khuếch tán sang nhau và tạo ra năng lượng ánh sáng. Mỗi mức năng lượng được giải phóng ra khác nhau là cao hay thấp, bước sóng ánh sáng cũng khác nhau. Màu sắc của đèn ốp trần và mức năng lượng phụ thuộc vào cấu trúc năng lượng của những nguyên tử bán dẫn.','uploads/posts/featured/images.jpg',0,4,1,1,'0000-00-