EM CHEESE','Thạch dừa xiêm kem cheese  núng na núng nính được làm từ 100% dừa tươi nguyên chất vắt xay ( tuyệt đối ko dùng dừa lon ạ).','uploads/products/featured/thach dua.jpg',NULL,'thach-dua-xiem-kem-cheese-460',0.00,'2023-11-30 01:26:45','2024-06-29 05:51:18',NULL),(315,'Cá khô sông sê san','admin',4,77,65,NULL,NULL,'[\"uploads\\/products\\/thumbnail\\/ca kho 2.jpg\",\"uploads\\/products\\/thumbnail\\/ca kho.jpg\"]','uploads/products/thumbnail/ca kho 2.jpg','uploads/products/featured/ca kho 2.jpg','uploads/products/featured/ca kho 2.jpg','youtube',NULL,'Cá khô sông sê san','<p style=\"text-align: justify;\">C&aacute; cơm kh&ocirc; l&agrave; một loại đặc sản Mẹ thi&ecirc;n nhi&ecirc;n ban tặng cho v&ugrave;ng đất T&acirc;y Nguy&ecirc;n nắng gi&oacute;, đ&acirc;y l&agrave; loại đặc sản T&acirc;y Nguy&ecirc;n nổi tiếng gắn liền với d&ograve;ng s&ocirc;ng S&ecirc; San h&ugrave;ng vĩ &ndash; C&aacute; cơm kh&ocirc; S&ecirc; San.</p>\r\n<p style=\"text-align: justify;\">L&agrave; lo&agrave;i c&aacute; nhỏ (chiều d&agrave;i khoảng 3 &ndash; 4cm), sinh sống nhiều trong khu vực l&ograve;ng hồ Thủy điện S&ecirc; San 4, tuy l&agrave; c&aacute; nước ngọt &iacute;t thịt nhưng rất b&eacute;o v&agrave; thơm ngon.</p>\r\n<p style=\"text-align: justify;\">C&aacute; cơm được tự do sinh sống trong l&ograve;ng hồ, thức ăn chủ yếu của ch&uacute;ng l&agrave; c&aacute;c sinh vật ph&ugrave; du. Ch&iacute;nh v&igrave; vậy m&agrave; thịt c&aacute; trong suốt, bụng sạch kh&ocirc;ng m&ugrave;i tanh khi bảo quản l&acirc;u.</p>\r\n<p style=\"text-align: justify;\">C&aacute; cơm kh&ocirc; sinh th&aacute;i hồ S&ecirc; San được đ&aacute;nh bắt bởi c&aacute;c ngư d&acirc;n sinh sống tại l&agrave;ng ch&agrave;i. Cứ mỗi chạng vạng, người d&acirc;n đi thuyền ra s&ocirc;ng v&agrave; sử dụng V&oacute; (Loại dụng cụ dạng lưới khoảng 10 đến 12m2, được căng bằng c&aacute;c c&acirc;y tre d&agrave;i 4 g&oacute;c) v&agrave; đ&egrave;n rất s&aacute;ng để thu h&uacute;t c&aacute; cơm.&nbsp;C&aacute; sẽ theo &aacute;nh s&aacute;ng v&agrave;o v&oacute;, sau đ&oacute; người d&acirc;n sẽ k&eacute;o v&oacute; v&agrave; thu được c&aacute; cơm.</p>\r\n<p style=\"text-align: justify;\">Sau khi thu gom, c&aacute; được phơi kỹ lưỡng, trực tiếp dưới &aacute;nh nắng mặt trời ngay tại l&ograve;ng hồ, đến tối được gom lại v&agrave; s&aacute;ng mai phơi 1 lần nữa. Sản phẩm c&aacute; cơm kh&ocirc; rất sạch, v&agrave;ng &oacute;ng &aacute;nh.</p>\r\n<h2 style=\"text-align: justify;\"><span class=\"ez-toc-section\" id=\"Gia_tri_dinh_duong_co_trong_ca_com\"></span>Gi&aacute; trị dinh dưỡng c&oacute; trong c&aacute; cơm</h2>\r\n<p style=\"text-align: justify;\">Nếu bạn lo sợ ăn c&aacute; kh&ocirc; sẽ bị b&eacute;o th&igrave; rất may l&agrave; c&aacute; cơm kh&ocirc; c&oacute; h&agrave;m lượng Omega-3, protein rất dồi d&agrave;o. Đ&acirc;y lại l&agrave; những chất hỗ trợ giảm c&acirc;n rất hiệu quả, c&oacute; thể gi&uacute;p ngăn ngừa nguy cơ b&eacute;o ph&igrave;.</p>\r\n<p style=\"text-align: justify;\">Điểm quan trong ở c&aacute; cơm sinh th&aacute;i hồ S&ecirc; San ch&iacute;nh l&agrave; &ldquo;Sạch&rdquo;. Sạch từ thức ăn của c&aacute;, m&ocirc;i trường sống đến qu&aacute; tr&igrave;nh đ&aacute;nh bắt, bảo quản, ho&agrave;n to&agrave;n được đảm bảo tự nhi&ecirc;n, kh&ocirc;ng bị &ocirc; nhiễm.</p>\r\n<p style=\"text-align: justify;\">B&ecirc;n cạnh đ&oacute;, c&aacute; nhỏ thường mang trong m&igrave;nh &iacute;t độc tố hơn, đặc biệt l&agrave; do v&ograve;ng đời ngắn n&ecirc;n ch&uacute;ng thường &iacute;t bi phơi nhiễm h&oacute;a chất v&agrave; độc tố so với c&aacute;c lo&agrave;i c&aacute; lớn.</p>\r\n<p><strong>Bảng th&agrave;nh phần dinh dưỡng trong c&aacute; cơm</strong></p>\r\n<table style=\"width: 100%; border-collapse: collapse; border-style: solid;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 21px;\">\r\n<td style=\"width: 39.1667%; height: 21px; text-align: center;\"><strong>Th&agrave;nh phần dinh dưỡng</strong></td>\r\n<td style=\"width: 60.8333%; height: 21px; text-align: center;\"><strong>Lợi &iacute;ch&nbsp;</strong></td>\r\n</tr>\r\n<tr style=\"height: 21px;\">\r\n<td style=\"width: 39.1667%; height: 21px; text-align: center;\">Axit b&eacute;o omega-3</td>\r\n<td style=\"width: 60.8333%; height: 21px; text-align: left;\">Cải thiện sức khoẻ tim mạch</td>\r\n</tr>\r\n<tr style=\"height: 21px;\">\r\n<td style=\"width: 39.1667%; height: 21px; text-align: center;\">Canxi v&agrave; vitamin A</td>\r\n<td style=\"width: 60.8333%; height: 21px; text-align: left;\">Cải thiện sức khoẻ hệ xương khớp, bảo vệ sức khỏe mắt</td>\r\n</tr>\r\n<tr style=\"height: 21px;\">\r\n<td style=\"width: 39.1667%; height: 21px; text-align: center;\">Sắt</td>\r\n<td style=\"width: 60.8333%; height: 21px; text-align: left;\">tăng cường cung cấp oxy v&agrave; lưu th&ocirc;ng m&aacute;u</td>\r\n</tr>\r\n<tr style=\"height: 23px;\">\r\n<td style=\"width: 39.1667%; height: 23px; text-align: center;\">Selenium</td>\r\n<td style=\"width: 60.8333%; height: 23px; text-align: left;\">Tăng cường chức năng tuần ho&agrave;n v&agrave; hormone tuyến gi&aacute;p</td>\r\n</tr>\r\n<tr style=\"height: 21px;\">\r\n<td style=\"width: 39.1667%; height: 21px; text-align: center;\">Vitamin B12 v&agrave; Niacin</td>\r\n<td style=\"width: 60.8333%; height: 21px; text-align: left;\">Duy tr&igrave; chức năng hệ thần kinh khỏe mạnh</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2 style=\"text-align: justify;\"><span class=\"ez-toc-section\" id=\"Ca_com_kho_lam_mon_gi_ngon\"></span>C&aacute; cơm kh&ocirc; l&agrave;m m&oacute;n g&igrave; ngon?</h2>\r\n<p style=\"text-align: justify;\">C&aacute; cơm kh&ocirc; c&oacute; đa dạng c&aacute;ch chế biến kh&aacute;c nhau. Đơn giản nhất l&agrave; bạn chi&ecirc;n v&agrave;ng rồi cho th&ecirc;m ch&uacute;t mắm, bột ngọt, ti&ecirc;u hoặc ớt l&agrave; đủ hao cơm.</p>\r\n<p style=\"text-align: justify;\">Hoặc c&oacute; thể kho c&aacute; cơm kh&ocirc; với thịt ba chỉ th&agrave;nh m&oacute;n để ăn cơm hợp với những ng&agrave;y mưa; hay mang c&aacute; cơm chi&ecirc;n rồi trộn với xo&agrave;i xanh th&aacute;i chỉ th&agrave;nh một m&oacute;n gỏi rất hợp l&agrave;m m&oacute;n nhậu cho anh nh&agrave;; ng&acirc;m sơ qua rồi rang l&ecirc;n nấu ch&aacute;o, rim với nước mắm me, sốt c&agrave; chua kh&ocirc; với h&agrave;nh ng&ograve; cũng ngon kh&oacute; cưỡng.</p>\r\n<p style=\"text-align: justify;\">Tuy c&aacute; cơm kh&ocirc; kh&ocirc;ng phải l&agrave; m&oacute;n thượng hạng, nhưng lại l&agrave;m &ldquo;si&ecirc;u l&ograve;ng&rdquo; kh&ocirc;ng &iacute;t thực kh&aacute;ch khi trải nghiệm lần đầu ti&ecirc;n.</p>',85000.00,0.00,'[{\"name\":\"choice_0\",\"title\":\"Tr\\u1ecdng l\\u01b0\\u1ee3ng\",\"options\":[\"0.5Kg\",\"1Kg\"]}]','[]','{\"0.5Kg\":{\"price\":\"85000\",\"sku\":\"Cksss-0.5Kg\",\"qty\":\"10\",\"img\":\"uploads\\/products\\/featured\\/ca kho 2.jpg\"},\"1Kg\":{\"price\":\"15000\",\"sku\":\"Cksss-1Kg\",\"qty\":\"10\",\"img\":\"uploads\\/products\\/featured\\/ca kho 2.jpg\"}}',0,0,0,0,'kg',0.00,'amount',0.00,'amount','flat_rate',0.00,0,'Cá khô sông sê san','Cá khô sông sê san','uploads/products/featured/ca kho 2.jpg',NULL,'ca-kho-song-se-san-913',0.00,'2023-11-30 01:31:56','2024-06-29 05:51:17',20),(316,'Ống đựng bút kèm đế pha lê K9 để bàn cao cấp','admin',4,94,NULL,NULL,NULL,'[\"uploads\\/products\\/thumbnail\\/ong-dung-but-kem-de-pha-le-k9-de-ban-cao-cap-lbwg002.jpg\",\"uploads\\/products\\/thumbnail\\/ong-dung-but-kem-de-pha-le-k9-de-ban-cao-cap-lbwg002-1.jpg\",\"uploads\\/products\\/thumbnail\\/ong-dung-but-kem-de-pha-le-k9-de-ban-cao-cap-lbwg002-2.jpg\",\"uploads\\/products\\/thumbnail\\/ong-dung-but-kem-de-pha-le-k9-de-ban-cao-cap-lbwg002-3.jpg\"]','uploads/products/thumbnail/ong-dung-but-kem-de-pha-le-k9-de-ban-cao-cap-lbwg002-2.jpg','uploads/products/featured/ong-dung-but-kem-de-pha-le-k9-de-ban-cao-cap-lbwg002-2.jpg','uploads/products/featured/ong-dung-but-kem-de-pha-le-k9-de-ban-cao-cap-lbwg002-2.jpg','youtube',NULL,'Ống đựng bút cao cấp,trang trí bàn làm việc','<p>Ống đựng b&ua