>\r\n                <div class=\"col-lg-4 col-sm-4\">\r\n                    <div class=\"single-box-item\">\r\n                        <div class=\"icon\">\r\n                            <img class=\"lazy loaded\" src=\"//bizweb.dktcdn.net/100/367/318/themes/737653/assets/policy_3.svg?1576815787127\" data-src=\"//bizweb.dktcdn.net/100/367/318/themes/737653/assets/policy_3.svg?1576815787127\" alt=\"Người giúp việc tiêu chuẩn\" data-was-processed=\"true\">\r\n                        </div>\r\n                        <h3>Tiết kiệm chi phí</h3>\r\n                        <p>Máy cắt CNC Laser cho khả năng gia công cơ khí chính xác, giảm thiểu khả năng hư hỏng. Nhờ đó, năng suất làm việc cao, chi phí gia công thấp hơn hẳn các phương pháp khác..</p>\r\n                       \r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </section>\r\n</section>','<script>\r\nconsole.log(\'widget dich vu trang chu loaded\');\r\n</script>','<style>\r\n\r\n</style>',0,NULL,'2020-02-22 01:34:24','2020-03-04 16:47:20'),(44,'Giới thiệu trang chủ','[gioi-thieu-trang-chu]','Module giới thiệu trên trang chủ - evostyle','','<section class=\"awe-section-3\">\r\n    <div class=\"section_about\">\r\n        <div class=\"container\">\r\n            <div class=\"row\">\r\n                <div class=\"col-lg-6 about-content\">\r\n                    <span>Giới\r\n                    thiệu</span>\r\n                    <h3>AFFILIATE MARKETING KIẾM TIỀN HÔM NAY</h3>\r\n                    <p>Kinh doanh Online đang là một xu thế và thực sự kinh doanh Online cũng là một công việc tay trái của rất nhiều người. Nhưng đa số những người kinh doanh online đang làm sai phương pháp và mới chỉ dừng lại ở việc rao vặt hoặc post bài\r\n                        facebook.\r\n                    </p>\r\n                    <p>Để khởi sự kinh doanh online bài bản có doanh số tức thì, thừa hưởng được những giá trị về sau thì bạn cần phải có một người thầy kinh nghiệm để dẫn dắt từ Chiến lược, Hệ thống, Quy Trình và Công Cụ...</p>\r\n                    <ul>\r\n                    </ul>\r\n\r\n                    <a href=\"#\" title=\"Xem thêm\">Xem thêm</a>\r\n                </div>\r\n                <div class=\"col-lg-6 about-image\">\r\n<img src=\"data:image/jpeg;base64,\">\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>','<script>\r\nconsole.log(\'widget gioi thieu trang chu loaded\');\r\n</script>','<style>\r\n    .section_about {\r\n        padding: 30px 0;\r\n    }\r\n    .section_about .about-content span {\r\n        color: \r\n        #59ca6d;\r\n        font-size: 14px;\r\n        text-transform: uppercase;\r\n        display: block;\r\n    }\r\n    .section_about .about-content h3 {\r\n        font-size: 34px;\r\n        font-weight: 700;\r\n        margin-top: 5px;\r\n        margin-bottom: 10px;\r\n        line-height: 1.2;\r\n    }\r\n    .section_about .about-content p {\r\n        color: \r\n        #777;\r\n        line-height: 1.8;\r\n        max-width: 450px;\r\n        margin-bottom: 0;\r\n        margin-top: 10px;\r\n    }\r\n    .section_about .about-content ul {\r\n        display: -ms-flexbox;\r\n        display: -webkit-box;\r\n        display: flex;\r\n        -ms-flex-wrap: wrap;\r\n        flex-wrap: wrap;\r\n        padding-left: 0;\r\n        list-style-type: none;\r\n        margin-right: -10px;\r\n        margin-bottom: 5px;\r\n        margin-top: 5px;\r\n    }\r\n    .section_about .about-content ul li {\r\n        font-weight: 600;\r\n        color: \r\n        #777;\r\n    }\r\n    .section_about .about-content p {\r\n        color: \r\n        #777;\r\n        line-height: 1.8;\r\n        max-width: 450px;\r\n        margin-bottom: 0;\r\n        margin-top: 10px;\r\n    }\r\n    .section_about .about-content a {\r\n        background-color: \r\n    #377dff;\r\n    border: 1px solid\r\n    #377dff;\r\n    height: 40px;\r\n    padding: 0 20px;\r\